import React from "react";
import { DivLogin, HeaderContent, Body, Input, Button } from "./style/login";
import { useNavigate } from "react-router-dom";
const Login = () => {
  const navigate = useNavigate();
  return (
    <Body>
      <DivLogin>
        <HeaderContent>
          <h1>Log In</h1>
        </HeaderContent>

        <form onSubmit={handleSubmit(onSubmit)}>
          <Input
            type="email"
            name="mail"
            placeholder="Enter Your Email"
            {...register("mail", {
              required: true,
              minLength: 4,
              maxLength: 20,
            })}
            required
          />
          <Input
            type="password"
            name="pwd"
            placeholder="Enter Your Password"
            {...register("pwd", {
              required: true,
              minLength: 4,
              maxLength: 20,
            })}
            required
          />
          <Button
            type="submit"
            onClick={() => {
              navigate("/");
            }}
          >
            Log In
          </Button>
        </form>
      </DivLogin>
    </Body>
  );
};

export default Login;
